import React from 'react';
import { useSelector } from 'react-redux';
import { RootState } from '../redux/store.ts';

const TablePage: React.FC = () => {
  const tableData = useSelector((state: RootState) => state.table.tableData);

  return (
    <div>
      <h1>Tabulka</h1>
      <table>
        <thead>
          <tr>
            <th>Pořadí</th>
            <th>Tým</th>
            <th>Zápasy</th>
            <th>Výhry</th>
            <th>Remízy</th>
            <th>Prohry</th>
            <th>Body</th>
          </tr>
        </thead>
        <tbody>
          {tableData.map((team, index) => (
            <tr key={team.id}>
              <td>{index + 1}</td>
              <td>{team.name}</td>
              <td>{team.matches}</td>
              <td>{team.wins}</td>
              <td>{team.draws}</td>
              <td>{team.losses}</td>
              <td>{team.points}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TablePage;
